            </video>
            <div className="header-content">
            <h1>Our Services</h1>
            <p>Explore the range of services we offer to help you succeed.</p>
            </div>
        </div>

        <div className="services-content">
            <h2>What We Offer</h2>
            <p>We provide a variety of virtual assistant services tailored to your needs.</p>
            {/* Add more content about services here */}
        </div>
    </div>
  );
}

export default Services;
